import './App.css';
import {Routes, Route} from "react-router-dom";
import Navbar from './components/Navbar';
import Favorite from './components/Favorite';


function App() {
  return (
    <div className="App">
      <Navbar/>
      <Routes>

        <Route path='/favorites' element={<Favorite/>} />
      </Routes>

    </div>
  );
}

export default App;
